import sys

def solve():
	empty = [''] * 4
	x = 0
	o = 0
	for line in sys.stdin:
		if line.endswith('x'):
			x += 1
		elif line.endswith('o'):
			o += 1
		else:
			empty[x][o] = line
			x = 0
			o = 0
	if x + o == 4:
		print('YES')
	else:
		print('NO')

def __starting_point():
	solve()

